webpackJsonp([0xfda72e3dad4e],{1130:function(A,e){A.exports={data:{markdownRemark:{html:'<p>If you are a ID newbie, or someone who wants to learn a new skill, your number one question is, how can I get experience? I will always recommend that you <a href="/blog/seriously-though-the-answer-is-make-stuff/">start making stuff.</a> But where do you get ideas? I have a lot of thoughts on this, <a href="/blog/civic-learning-an-idea-generated-from-torrance-learnings-download-un-conference/">my latest one is about civic learning</a>, but our last episode with Simon Date, we talk about open source, the philosophy behind it, and why IDs might want to jump in.</p>\n<iframe src="https://simplecast.com/e/72554?style=medium-light" width="100%" height="94px" frameborder="0" scrolling="no" seamless=""></iframe>\n<p>As always, check out the shownotes on the show page: <a href="https://dearinstructionaldesigner.simplecast.fm/">https://dearinstructionaldesigner.simplecast.fm/</a> And don’t forget to <a href="itms://itunes.apple.com/us/podcast/dear-instructional-designer/id1111995456?mt=2">leave a rating and review for us on iTunes</a>.</p>',frontmatter:{date:"June 15, 2017",path:"/blog/dearid-episode-46-simon-date-on-open-source",title:"#DearID Episode 46: Simon Date on Open Source",tags:["dear id","maker challenge","making","open source"],categories:["Dear ID Show","Inspiration","Tips"],featured:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:3,src:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg",srcSet:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c7d05.jpg 203w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-784f5.jpg 405w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg 810w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-adada.jpg 1215w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-1c372.jpg 1500w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
